import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  useLocation
} from "react-router-dom";
import Header from "./components/Header";
import BackgroundVideo from "./components/BackgroundVideo";
import ArtistDashboard from "./components/board/ArtistDashboard";
import Dashboard from "./components/userboard/UserDashboard";
import UserProfile from "./components/userboard/UserProfile";
import CartPage from "./components/userboard/CartPage";
import OrderDetails from "./components/userboard/OrderDetails"; // ✅ Order details
import Profile from "./components/board/Profile";
import Login from "./components/auth/Login";
import Register from "./components/auth/Register";
import ProtectedRoute from "./components/ProtectedRoute";
import StripeContainer from "./components/userboard/StripeContainer"; // ✅ Import StripeContainer

function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}

function AppContent() {
  const location = useLocation();
  const token = localStorage.getItem("token");
  const userRole = localStorage.getItem("role");

  return (
    <div className="app-container">
      {/* Show background video only on login or register */}
      {(location.pathname === "/login" || location.pathname === "/register") && (
        <BackgroundVideo />
      )}

      {/* Show header only on certain pages */}
      {!["/artist-dashboard", "/dashboard", "/userprofile"].includes(location.pathname) && (
        <Header />
      )}

      <Switch>
        <Route exact path="/">
          {token ? (
            userRole === "artist" ? (
              <Redirect to="/artist-dashboard" />
            ) : (
              <Redirect to="/dashboard" />
            )
          ) : (
            <Redirect to="/login" />
          )}
        </Route>

        <Route exact path="/login" render={(props) => <Login {...props} />} />
        <Route exact path="/register" render={(props) => <Register {...props} />} />

        {/* Protected Routes */}
        <ProtectedRoute
          exact
          path="/artist-dashboard"
          component={ArtistDashboard}
          requiredRole="artist"
        />

        <ProtectedRoute
          exact
          path="/dashboard"
          component={Dashboard}
          requiredRole="buyer"
        />

        <ProtectedRoute exact path="/profile" component={Profile} />
        <ProtectedRoute
          exact
          path="/userprofile"
          component={UserProfile}
          requiredRole="buyer"
        />
        <ProtectedRoute
          exact
          path="/cart"
          component={CartPage}
          requiredRole="buyer"
        />



<ProtectedRoute
  exact
  path="/orders/:orderId"
  component={OrderDetails}
  requiredRole="buyer"
/>


        {/* 404 Page */}
        <Route path="*">
          <h2 className="text-center text-white mt-10 text-xl">404 - Page Not Found</h2>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
